using System.Collections.ObjectModel;
using TipCalculator.Models;

namespace TipCalculator;

public partial class RestaurantsPage : ContentPage
{
    public ObservableCollection<Restaurant> Restaurants { get; set; }

    public RestaurantsPage()
    {
        InitializeComponent();
        Restaurants = new()
        {
            new Restaurant
            {
                Name = "Restaurant 1",
                TipPercentage = 10,
                ImageUrl =
                    "data:image/jpeg;base64,"
            },
            new Restaurant
            {
                Name = "Restaurant 2",
                TipPercentage = 20,
                ImageUrl =
                    "data:image/jpeg;base64,"
            },
            new Restaurant
            {
                Name = "Restaurant 3",
                TipPercentage = 30,
                ImageUrl =
                    "data:image/jpeg;base64,"
            },
            new Restaurant
            {
                Name = "Restaurant 4",
                TipPercentage = 40,
                ImageUrl =
                    "data:image/jpeg;base64,"
            },
            new Restaurant
            {
                Name = "Restaurant 5",
                TipPercentage = 50,
                ImageUrl =
                    "data:image/jpeg;base64,"
            }
        };
        BindingContext = this;
    }

    private void AddButton_OnClicked(object? sender, EventArgs e)
    {
        Restaurants.Add(new Restaurant
        {
            Name = "Restaurant 6",
            TipPercentage = 60,
            ImageUrl =
                "data:image/jpeg;base64,"
        });
    }

    private void Collection_OnSelectionChanged(object? sender, SelectionChangedEventArgs e)
    {
        Restaurant? eCurrentSelection = (Restaurant)e.CurrentSelection[0];
        if (eCurrentSelection != null)
        {
            Restaurants.Remove(Restaurants.First(x => x.Name == eCurrentSelection.Name));
        }
    }
}